import React from 'react';
import './main.css'; // Import your CSS file
import backgroundImage from './Assets/background.jpg';
import {Link} from "react-router-dom"; // Adjust the path as per your directory structure

const index = () => {
    return (
        <div className="main" style={{ backgroundImage: `url(${backgroundImage})` }}>
            <h1>Welcome to the Contact App</h1>
            <Link to="/login">Log In</Link>
            <Link to="/register">Register</Link>
        </div>
    );
};

export default index;
